import styled from 'styled-components';
import Link from 'next/link';
import Nav from './Nav';

const Logo = styled.h1`
  background: red;
`;

const Header = () => {
  return (
    <header>
      <div className='bar'>
        <Link href='/'>
          <Logo>Sick fits</Logo>
        </Link>
      </div>
      <div className='sub-bar'>
        <p>search</p>
      </div>
      <Nav />
    </header>
  );
};

export default Header;
